app.service("myService",["$q","$http",function(e,r){this.getNavigation=function(){var t=e.defer();return r({method:"GET",url:"/json/nav.json"}).success(function(e){t.resolve(e)}).error(function(e){t.reject(e)}),t.promise},this.getBackgrounds=function(){var t=e.defer();return r({method:"GET",url:"/json/bg.json"}).success(function(e){t.resolve(e)}).error(function(e){t.reject(e)}),t.promise}}]);